import { useEffect } from "react";
import { Route, Routes } from "react-router-dom";
import "./AfterLoginBlock.css";

import Profile from "./AfterLoginComponent/Profile";

const AfterLoginBlock = () => {

  const [RHS,setRHS]=useState("");

  function Redirect(){
    return(      
        <Profile/>                    
    );
  }


  return (
    <div className="AfterLoginBlockMain">
      <div className="LHSBlock">
        <div>
          <div>
            <button type="button" onClick={setRHS("Profiile")} className="btn btn-light Btn-Custom-Size ">
              Profile
            </button>
          </div>
          <div>
            <button type="button" className="btn btn-light Btn-Custom-Size">
              Appointment
            </button>
          </div>
          <div>
            <button type="button" className="btn btn-light Btn-Custom-Size">
              Booking History
            </button>
          </div>
          <div>
            <button type="button" className="btn btn-light Btn-Custom-Size">
              LogOut
            </button>
          </div>
        </div>
      </div>
      <div className="RHSBlock">
        <Profile data={RHS}/>
      </div>
    </div>
  );
};

export default AfterLoginBlock;
